我们可以使用以下代码来提取这些图形文件：

```
\foreach\graphics{
  \graphicspath{\node[shape=rectangle,fill=color.red,linecolor=color.black,linewidth=0.5\textwidth}{!{\graphics[width=0.5\textwidth]{pf.jpeg}ot}};
  \node[label={\graphicspath{[scale=0.8,at=*}<>}<>}};
}
```

